    class all_scriptsPage extends Page
    {
        protected function DoBeforeCreate()
        {
            $this->SetTitle('All Documents');
            $this->SetMenuLabel('All Documents');
    
            $this->dataset = new TableDataset(
                MyPDOConnectionFactory::getInstance(),
                GetConnectionOptions(),
                '`all_scripts`');
            $this->dataset->addFields(
                array(
                    new IntegerField('id', true, true, true),
                    new StringField('category', true),
                    new StringField('script', true),
                    new IntegerField('user_id'),
                    new StringField('user_name'),
                    new DateTimeField('record_time'),
                    new StringField('subject'),
                    new StringField('file_upload'),
                    new StringField('image_upload'),
                    new StringField('audio_upload'),
                    new StringField('video_upload'),
                    new StringField('video_embed')
                )
            );
            $this->dataset->AddLookupField('category', 'all_categories', new StringField('category'), new StringField('category', false, false, false, false, 'category_category', 'category_category_all_categories'), 'category_category_all_categories');
            if (!$this->GetSecurityInfo()->HasAdminGrant()) {
                $this->dataset->setRlsPolicy(new RlsPolicy('user_id', GetApplication()->GetCurrentUserId()));
            }
        }
    
        protected function DoPrepare() {
    
        }
    
        protected function CreatePageNavigator()
        {
            $result = new CompositePageNavigator($this);
            
            $partitionNavigator = new PageNavigator('pnav', $this, $this->dataset);
            $partitionNavigator->SetRowsPerPage(20);
            $result->AddPageNavigator($partitionNavigator);
            
            return $result;
        }
    
